    //   infinite: true,
    //   initialSlide: 0,
    //   slidesToShow: 1,
    //   slidesToScroll: 1,
    //   swipeToSlide: true,
    // };
  return (
    <>
      <Header />
        <BannerSlider />
        <Product />
        <About />
        <Contact />
      

      <Footer />
    </>
  );
}
export default Home;
